INSERT INTO `exam_subject_option` VALUES ('1573036954368036', '1573036954368035', 'A', '90-', '笔者近5年一直关注北京的高考真题与各大区的高三模考，笔者明显能感受到海淀区的命题老师一直在题目上追求变化和新颖，相比有些城区的“稳”，笔者觉得海淀的题目富有新意，能考查出考生是对数学知识的本质理解，还是机械的复用解题套路。这一点笔者给海淀的老师手动点赞。但是一套试卷是分层的，部分题目推陈出新，但是还是有大量基础题目。90分以下，还是有很多基础工作可以做，基本的概念需要加强，基本的套路需要熟悉等等。模拟考试只是为了检验阶段的复习成果，好饭不怕晚，请千万不要失去信心。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1573036954368037', '1573036954368035', 'B', '90+', '笔者近5年一直关注北京的高考真题与各大区的高三模考，笔者明显能感受到海淀区的命题老师一直在题目上追求变化和新颖，相比有些城区的“稳”，笔者觉得海淀的题目富有新意，能考查出考生是对数学知识的本质理解，还是机械的复用解题套路。这一点笔者给海淀的老师手动点赞。但是一套试卷是分层的，部分题目推陈出新，但是还是有大量基础题目。90多分，说明对基础掌握的比较好，但是缺少对基本知识的灵活运用能力。这一点随着高三复习的不断深入，做题量的累计，会有很大的改善，请千万加油，珍惜。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1573036954368038', '1573036954368035', 'C', '120+', '笔者近5年一直关注北京的高考真题与各大区的高三模考，笔者明显能感受到海淀区的命题老师一直在题目上追求变化和新颖，相比有些城区的“稳”，笔者觉得海淀的题目富有新意，能考查出考生是对数学知识的本质理解，还是机械的复用解题套路。这一点笔者给海淀的老师手动点赞。但是一套试卷是分层的，部分题目推陈出新，但是还是有大量基础题目。120多分确实是个瓶颈，因为拿不到的分数往往都是题目的题眼，是最灵活，也是命题人最用心的部分。可以有针对性的进行练习，补强，争取早日突破瓶颈。', NULL, NULL, NULL, 0, NULL, NULL);
