INSERT INTO `exam_subject_option` VALUES ('1574817876718598', '1574817876717596', 'B', 'B', '考查氧化铁胶体制备的注意事项，这个是在暑秋一轮复习的开始阶段的，比较重要的实验之一，考点和坑较多，学生要熟练掌握。', NULL, NULL, NULL, 0, NULL, NULL);
