INSERT INTO `exam_subject_option` VALUES ('1574817876764617', '1574817876764616', 'A', '少于等于2分', '考查考生的信息获取加工能力，题干的11度液化，联想到冰水的液化作用、另外考查氯气和碱的基础离子方程式，这两空也是送分项。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876764618', '1574817876764616', 'B', '3分到4分', '考查物质分离中的萃取方法，以及萃取剂四氯化碳密度与水的关系、卤素单质在有机层颜色。这是高一基础部分，丢分只能说一轮开始阶段复习不够扎实，或方法不得当，赶紧调整。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876764619', '1574817876764616', 'C', '5分到8分', '考查物质氧化性和还原性方面性质、陌生方程式书写的能力。学生对氧化还原这个高考核心内容，还需要多练啊。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876764620', '1574817876764616', 'D', '9分到10分', '对传统净水剂的净水原理的掌握，还需加强，这样才能升华到新型水处理试剂的性质和功能原理的理解和应用。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876777622', '1574817876777621', 'A', 'A', '基础方程式考查，稀盐酸除铁锈的方程式，比较简单。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876777623', '1574817876777621', 'B', 'B', '基础方程式考查，稍有难度，审题要注意“少量”俩字，考查与量有关的方程式的书写。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876777624', '1574817876777621', 'C', 'C', '基础方程式考查，钠和水的方程式，比较基础。', NULL, NULL, NULL, 0, NULL, NULL);
