INSERT INTO `exam_subject_option` VALUES ('1574817876797628', '1574817876797626', 'B', 'B', '通过硫与氧气反应产物的探究实验，考查学生实验分析能力，还是有一定难度。B项硫的产生，多种途径的二氧化硫和硫化钠归中、硫化钠被氧气氧化都可。', NULL, NULL, NULL, 0, NULL, NULL);
