INSERT INTO `exam_subject_option` VALUES ('1574817876874662', '1574817876874661', 'A', 'A', '以含氮废水的处理为素材，综合了物质性质、化学平衡，氧化还原、方程式等考点，考查学生接受整合信息的能力、分析解决问题能力。特别是对脱氮的题干关键词语的审题理解到位：“需将其从水体中除去，该过程称为脱氮”。', NULL, NULL, NULL, 0, NULL, NULL);
