INSERT INTO `exam_subject_option` VALUES ('1574817876885667', '1574817876885666', 'A', '少于等于3分', '以温室效应气体为突破口的一道元素推断习题，考查原子结构和电子式书写，比较基础，送分的空，如果还错，那化学就得需要从头拼命恶补了。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876885668', '1574817876885666', 'B', '4分到8分', '从原子结构、性质等方面过渡到对元素周期律递变规律的考查：非金属性强弱的具体体现。这部分内容，是对元素化合物性质递变规律的本质认识，如果丢分，那就是对个别性质变化的没有掌握其本质。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876885669', '1574817876885666', 'C', '9分到10分', '通过熟悉物质的性质，通过元素周期律延伸到陌生物质，然后考查了对其性质预判，以及陌生方程式的书写。这部分学好，除了物质性质的积累，还要多动脑思考物质变化的规律背后的本质。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876885670', '1574817876885666', 'D', '11分到12分', '最后一问考查还是有难度的，通过陌生物质的氧化还原反应的电子守恒，判断元素化合价，再推导出元素的周期表中位置，这也是80分以上的学生必须要具备的计算准确，推导严谨的素质。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876896672', '1574817876896671', 'A', '少于等于2分', '三价铁离子检验的基础离子方程式的考查，送分项。丢分的学生，你得反思一下元素化合物部分的基础知识，你是否都学会，掌握了', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876896673', '1574817876896671', 'B', '3分到6分', '从物质性质、反应、量的关系、物质检验等方面综合考查学生逻辑分析、推导能力。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876896674', '1574817876896671', 'C', '7分到10分', '对异常现象的分析、到逻辑推导、合理猜想、设计实验去验证猜想，需要学生看懂出题人每一步的目的是什么，才能填出来他的空。同时对作答的规范性要求也很严谨，例如试剂的浓度、体积、酸碱性你都考虑了吗，还是只写了物质。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876896675', '1574817876896671', 'D', '11分到15分', '根据对整个实验题的探究过程，考查学生对未知问题或者异常想象的分析、猜想、逻辑推理、严谨表述，规范作答，全方位考查了学生的化学素养，难度较大。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876907677', '1574817876907676', 'A', 'A', '元素化合物的性质以及转化，是化学的核心内容。该题考查学生对元素化合物性质与转化关系熟悉程度以及逻辑推理能力。该题选出B还有稍有难度的。另外把其余选项都推导清晰难上加难，验证了那句话：元素化合物难度无上限。ABC满足条件转化的物质，你能写出10种以上吗？我给你打7.5分，13种呢？我给你打9分。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876907678', '1574817876907676', 'B', 'B', '元素化合物的性质以及转化，是化学的核心内容。该题考查学生对元素化合物性质与转化关系熟悉程度以及逻辑推理能力。该题选出B还有稍有难度的。另外把其余选项都推导清晰难上加难，验证了那句话：元素化合物难度无上限。ABC满足条件转化的物质，你能写出10种以上吗？我给你打7.5分，13种呢？我给你打10分。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876907679', '1574817876907676', 'C', 'C', '元素化合物的性质以及转化，是化学的核心内容。该题考查学生对元素化合物性质与转化关系熟悉程度以及逻辑推理能力。该题选出B还有稍有难度的。另外把其余选项都推导清晰难上加难，验证了那句话：元素化合物难度无上限。ABC满足条件转化的物质，你能写出10种以上吗？我给你打7.5分，13种呢？我给你打11分。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876907680', '1574817876907676', 'D', 'D', '元素化合物的性质以及转化，是化学的核心内容。该题考查学生对元素化合物性质与转化关系熟悉程度以及逻辑推理能力。该题选出B还有稍有难度的。另外把其余选项都推导清晰难上加难，验证了那句话：元素化合物难度无上限。ABC满足条件转化的物质，你能写出10种以上吗？我给你打7.5分，13种呢？我给你打12分。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876919682', '1574817876919681', 'A', '少于等于3分', '实验中控制变量对化学反应速率的探究，以及从物质性质出发，对反应快慢的现象描述。不是送分题，但也是基础分值。还需对基础知识部分，打牢基础，记清知识点。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876919683', '1574817876919681', 'B', '4分到5分', '结合实际生产，考查学生对酸碱性条件控制对生产的影响，此外的语言组织归纳和表述也至关重要。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876919684', '1574817876919681', 'C', '6分到8分', '对催化剂参与反应的反应历程的理解和把握、陌生氧还方程式的书写，是对元素化合物的性质的高阶考题，对学生对陌生物质的性质的理解，题干关键信息的审题、提取都有门槛。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817876919685', '1574817876919681', 'D', '9分到10分', '考查两个过程消耗的氧化剂的物质的量，过程比较稍有复杂，看学生能不能灵活应用守恒的思想、列出式子，准确计算出结果。', NULL, NULL, NULL, 0, NULL, NULL);
