INSERT INTO `exam_subject_option` VALUES ('1574817887408818', '1574817887408815', 'C', '4分', '概括能力的考查，考生推荐理由体现了主题，表述欠妥', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574817887408819', '1574817887408815', 'D', '6分', '概括能力的考查，考生推荐理由主题明确，表达合理', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574818421396965', '1574817865840568', 'A', '60-', '近两年北京高考与各区的高三统考表现出来回归课本、注重基础知识运用的趋势，特别是考查基础内容的推导证明、分析说明问题的比重增大，所以对于考生而言，”得基础者得天下“还是有一定道理的。对于60分以下的基础薄弱的同学，不要灰心，后续的复习要调整复习方式，将重心放在课本基础知识和基础题型的训练上，并且要重视多次复习和循环练习。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574818421396966', '1574817865840568', 'B', '60 ', '近两年北京高考与各区的高三统考表现出来回归课本、注重基础知识运用的趋势，特别是考查基础内容的推导证明、分析说明问题的比重增大，所以对于考生而言，”得基础者得天下“还是有一定道理的。60-80分数段区间的学生首先要做的是夯实基础，多细读课本、提炼和总结基础题型的注意事项。基础扎实之后，重点训练分析问题的思路和技巧。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574818421396967', '1574817865840568', 'C', '80 ', '近两年北京高考与各区的高三统考表现出来回归课本、注重基础知识运用的趋势，特别是考查基础内容的推导证明、分析说明问题的比重增大，所以对于考生而言，”得基础者得天下“还是有一定道理的。80 的同学要在查漏补缺的同时、着重训练计算题的解题能力，从思路和计算两方面进行优化。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574818421396968', '1574817865840568', 'D', '90 ', '近两年北京高考与各区的高三统考表现出来回归课本、注重基础知识运用的趋势，特别是考查基础内容的推导证明、分析说明问题的比重增大，所以对于考生而言，”得基础者得天下“还是有一定道理的。这次考到90 的同学，可以在后续的复习中加入精读课本环节，彻底吃透课本内容的同时，训练梳理自己的知识体系、题型总结，提升解题时的高度，不止要把题目做出来，还要思路清晰、列式简洁明了、计算最优。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574818510819970', '1574817887141711', 'A', '90-', '笔者近5年一直关注北京的高考真题与各大区的高三模考，笔者觉得海淀的题目能考查出考生的语文学科能力。90分以下，还是有很多基础工作可以做，基本的概念需要加强，基本的方法需要熟悉等等。模拟考试只是为了检验阶段的复习成果，好饭不怕晚，请千万不要失去信心。', NULL, NULL, NULL, 0, NULL, NULL);
INSERT INTO `exam_subject_option` VALUES ('1574818510819971', '1574817887141711', 'B', '100 ', '笔者近5年一直关注北京的高考真题与各大区的高三模考，笔者觉得海淀的题目能考查出考生的语文学科能力。100多分，说明对基础掌握的比较好，但是缺少对基本知识的灵活运用能力。这一点随着高三复习的不断深入，做题量的累计，会有很大的改善，请千万加油，珍惜。', NULL, NULL, NULL, 0, NULL, NULL);
